@Override
public int hashCode() {
  int result = super.hashCode();
  long temp;
  temp = Double.doubleToLongBits(centerLon);
  result = 31 * result + (int) (temp ^ (temp >>> 32));
  temp = Double.doubleToLongBits(centerLat);
  result = 31 * result + (int) (temp ^ (temp >>> 32));
  temp = Double.doubleToLongBits(radius);
  result = 31 * result + (int) (temp ^ (temp >>> 32));
  return result;
}

